import React from 'react'

const cameraVid = require('./carsTest.mp4')

const cameraLayout = () => {

    let cameraFlexLayout = {
        dispay: 'flex',
        overflow: 'scroll',
        width: '100%',
        height: '100%',
        marginLeft: '-35px'
    }

    let videoStyle = {
        width: '40%',
        height: '200px'
    }

    return(
    <div>
        <h1>Camera Layou</h1>
        <div style = {cameraFlexLayout}>
            <video src={cameraVid} style = {videoStyle} autoPlay={true}></video>
        </div>
    </div>
    )
}

export default cameraLayout
